/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `travel_wallet` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `wallet_number` varchar(255) NOT NULL,
  `creator_id` bigint NOT NULL,
  `balance` double DEFAULT '0',
  `currency` varchar(255) NOT NULL,
  `bank_name` varchar(255) DEFAULT '바나나은행',
  `bank_code` varchar(255) DEFAULT '124',
  `share` tinyint(1) NOT NULL DEFAULT '0',
  `travel_id` bigint NOT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_TRAVEL_WALLET_CREATOR` (`creator_id`),
  KEY `FK_TRAVEL_WALLET_TRAVEL` (`travel_id`),
  CONSTRAINT `FK_TRAVEL_WALLET_CREATOR` FOREIGN KEY (`creator_id`) REFERENCES `member` (`id`),
  CONSTRAINT `FK_TRAVEL_WALLET_TRAVEL` FOREIGN KEY (`travel_id`) REFERENCES `travel` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=170 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
